import React from "react";
import Navbar from "../Component/Navbar";
import './timeline.css'; // Import the custom CSS

const Timeline=() => {
    return (
        <>
            <Navbar />
            <div className="main-content">
                <h1>Welcome to home page</h1>
            </div>
        </>
    );
};

export default Timeline;
